// HandlerWithOptions creates http.Handler with additional options
func HandlerWithOptions(si ServerInterface, options StdHTTPServerOptions) http.Handler {
	m := options.BaseRouter

	if m == nil {
		m = http.NewServeMux()
	}
	if options.ErrorHandlerFunc == nil {
		options.ErrorHandlerFunc = func(w http.ResponseWriter, r *http.Request, err error) {
			http.Error(w, err.Error(), http.StatusBadRequest)
		}
	}

	wrapper := ServerInterfaceWrapper{
		Handler:            si,
		HandlerMiddlewares: options.Middlewares,
		ErrorHandlerFunc:   options.ErrorHandlerFunc,
	}

	m.HandleFunc("GET "+options.BaseURL+"/insurance-auto", wrapper.GetInsuranceAuto)
	m.HandleFunc("GET "+options.BaseURL+"/insurance-auto/{policyId}/claim", wrapper.GetInsuranceAutopolicyIDClaims)
	m.HandleFunc("GET "+options.BaseURL+"/insurance-auto/{policyId}/policy-info", wrapper.GetInsuranceAutopolicyIDPolicyInfo)
	m.HandleFunc("GET "+options.BaseURL+"/insurance-auto/{policyId}/premium", wrapper.GetInsuranceAutopolicyIDPremium)

	return m
}

